_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2217:"　　“処女喪失”の特集を企画したＳ週刊誌の敏腕記者天野浩介は、ある男の来訪を受けた船乗りで山岸敬太と名のるその男は、彼の婚約者橋本綾子が送った手記をさしだした。橋本綾子は、田舎の中学を出ると、横浜で住み込み店員として働き、敬太と婚約したが、店の主人野津の暴力の前に純潔を奪われ、綾子は敬太との結婚をあきらめると、店をとびだして、遂に娼婦に身を崩していた。航海から帰った敬太に、偶然横浜のホテルで再会した綾子はショックから自殺したのだった。話を聞いた浩介は、直接面接に来ると言い置いた女性のうえに思いを馳せた。辻川さと子は、今はサラリーマンの妻となっているが、かつて大阪でバスガールであった時、同僚の恋人に犯され、東京へ職場を代えた。そして、全てを知ったうえで真面目な運転手辻川に求婚されたのだった。今西すえ子、彼女は病院の看護婦であったが、医長から将来を嘱望される外科医大杉春夫に身体を与えた。必ず結婚するという甘い言葉を信じたすえ子は、やがて医長の娘と結婚する大杉を見た。結婚式の当日、すえ子は、大杉夫妻の前で毒盃をあおいだ。桃井ミキ、彼女の手記は、義理の父に純潔を奪われ芸者に売られ、その後温泉あんまになり、今は洋裁学校に通うが、売春現行犯三回逮捕とあった。だが浩介の調べでは出鱈目で、彼女は結婚式場の巫女で、正真正銘の処女であった。処女を結婚へのパスポートとするミキは、それをたてにサラリーマン朝倉をてだまにとるプレイガールであった。処女性を持参金にするミキを憎んだ朝倉はミキに刃物で立ちむかっていった。手記を読んで暗澹たる気持の浩介のもとに、敬太は、旅先で知りあった雅子を連れて訪ねた。浩介はこの特集のしめくくりを“純潔はやはり結婚まで守るべきではなかろうか”と結んだ。";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:60:"HD高清$https://www.183757.com/20190220/jfqTPv30/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i