を飲み込み、非常階段から落ちて死んだ。有田はその死体の腹を割って、そっとダイヤを盗み、亜紀子と遊び歩いていたが、何とか彼女を堅気にもどそうとする宮本の耳に入り、また大矢根と宮本と有田の争いが再現した。だがダイヤは、亜紀子の手でマネキン人形の胸にかくされ、ある洋装店のウィンドに陳列されていた。宮本は配達夫に化けてこれを奪ったが、大矢根と有田は亜紀子を人質に宮本をおびきよせ、ここに拳銃火を吐く乱闘がくりひろげられた。ダイヤを手にした有田は大矢根に殺され、宮本と亜紀子はボイラー室に追いつめられて、むし殺されそうになる。その時警官隊が建物を囲み、追われてボイラー室に入った大矢根は、宮本に殺されるが、その時ダイヤも火と燃える石炭の中にころげ落ちて行った。危いところを救われた宮本と亜紀子は、正しく生きることを刑事に誓った。";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:60:"HD高清$https://www.183757.com/20190306/HghnRoxf/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:20;s:9:"type_name";s:6:"福利";s:7:"type_en";s:4:"fuli";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:8:"childids";N;}s:6:"type_1";N;}i:18;a:80:{s:6:"vod_id";i:77677;s:7:"type_id";i:20;s:9:"type_id_1";i:0;s:8:"group_id";i:0;s:8:"vod_name";s:30:"黑天使 1 黒の天使 Vol.1";s:7:"vod_sub";s:0:"";s:6:"vod_en";s:25:"heitianshi1heitianshiVol1";s:10:"vod_status";i:1;s:10:"vod_letter";s:1:"H";s:9:"vod_color";s:0:"";s:7:"vod_tag";s:0:"";s:9:"vod_class";s:6:"理论";s:7:"vod_pic";s:72:"http://cj.subo8988.com:8988/upload/vod/2019-03-07/201903071551947626.png";s:13:"vod_pic_thumb";s:0:"";s:13:"vod_pic_slide";s:0:"";s:9:"vod_actor";s:41:"葉月里緒菜,高島礼子,根津甚八";s:12:"vod_director";s:9:"石井隆";s:10:"vod_writer";s:0:"";s:10:"vod_behind";s:0:"";s:9:"vod_blurb";s:296:"慧子（葉月里緒菜饰）一出世就被黑社会老大收养，但不幸在其六岁时全家惨遭灭门老管家将其托付给组织里的女杀手黑天使（高島礼子饰）。在黑天使得保护下，慧子平安到达美国洛杉矶